    "summary": "Tropical Ice Pops might be just the dessert you are searching for. This recipe serves 6 and costs 93 cents per serving. Watching your figure? This gluten free and vegan recipe has <b>101 calories</b>, <b>0g of protein</b>, and <b>3g of fat</b> per serving. A mixture of pineapple, popsicle moulds, mango, and a handful of other ingredients are all it takes to make this recipe so delicious. This recipe is liked by 11 foodies and cooks. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 64%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/how-to-make-a-tropical-ice-cream-sandwich-908115\">How to make a Tropical Ice Cream Sandwich</a>, <a href=\"https://spoonacular.com/recipes/cold-brew-coffee-latte-ice-pops-912354\">Cold Brew Coffee Latte Ice Pops</a>, and <a href=\"https://spoonacular.com/recipes/tropical-strawberry-pops-450382\">Tropical Strawberry Pops</a> for similar recipes.",
