    "summary": "Roasted Brussels Sprouts With Red Onions and Pancetta requires about <b>about 45 minutes</b> from start to finish. This recipe makes 5 servings with <b>178 calories</b>, <b>8g of protein</b>, and <b>10g of fat</b> each. For <b>$1.88 per serving</b>, this recipe <b>covers 19%</b> of your daily requirements of vitamins and minerals. 31 person were glad they tried this recipe. It works well as an affordable side dish for <b>Christmas</b>. It is brought to you by Foodista. A mixture of brussels sprouts, bread, garlic, and a handful of other ingredients are all it takes to make this recipe so tasty. It is a good option if you're following a <b>dairy free</b> diet. Overall, this recipe earns a <b>good spoonacular score of 77%</b>. Try <a href=\"https://spoonacular.com/recipes/roasted-brussels-sprouts-and-red-onions-92485\">Roasted Brussels Sprouts and Red Onions</a>, <a href=\"https://spoonacular.com/recipes/roasted-brussels-sprouts-with-pancetta-292789\">Roasted Brussels Sprouts with Pancetta</a>, and <a href=\"https://spoonacular.com/recipes/roasted-brussels-sprouts-with-pancetta-943110\">Roasted Brussels Sprouts with Pancetta</a> for similar recipes.",
