    "summary": "Korean Extra Crispy Fried Chicken w Sweet Spicy Glaze is a <b>gluten free and dairy free</b> main course. This recipe makes 6 servings with <b>672 calories</b>, <b>40g of protein</b>, and <b>32g of fat</b> each. For <b>$1.92 per serving</b>, this recipe <b>covers 18%</b> of your daily requirements of vitamins and minerals. 7 people have tried and liked this recipe. This recipe from Foodista requires honey, water, garlic, and brown sugar. Not a lot of people really liked this Southern dish. From preparation to the plate, this recipe takes about <b>about 45 minutes</b>. With a spoonacular <b>score of 41%</b>, this dish is good. Try <a href=\"https://spoonacular.com/recipes/korean-extra-crispy-fried-chicken-649048\">Korean Extra Crispy Fried Chicken</a>, <a href=\"https://spoonacular.com/recipes/extra-crispy-spicy-fried-chicken-515706\">Extra Crispy Spicy Fried Chicken</a>, and <a href=\"https://spoonacular.com/recipes/extra-crispy-spicy-fried-chicken-with-delta-sauce-506756\">Extra-Crispy Spicy Fried Chicken with “Delta” Sauce</a> for similar recipes.",
