    "summary": "Butternut Squash Gnocchi With Whiskey Cream Sauce requires about <b>approximately 45 minutes</b> from start to finish. This recipe serves 4 and costs $3.72 per serving. One serving contains <b>527 calories</b>, <b>14g of protein</b>, and <b>23g of fat</b>. 72 people have made this recipe and would make it again. It is brought to you by Foodista. Head to the store and pick up salt, shallots, thyme leaves, and a few other things to make it today. It is a <b>rather pricey</b> recipe for fans of Mediterranean food. A couple people really liked this main course. All things considered, we decided this recipe <b>deserves a spoonacular score of 59%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/butternut-squash-gnocchi-with-whiskey-cream-sauce-552216\">Butternut Squash Gnocchi with Whiskey Cream Sauce</a>, <a href=\"https://spoonacular.com/recipes/butternut-squash-gnocchi-with-whiskey-cream-sauce-77415\">Butternut Squash Gnocchi With Whiskey Cream Sauce</a>, and <a href=\"https://spoonacular.com/recipes/butternut-squash-gnocchi-77311\">Butternut Squash Gnocchi</a> for similar recipes.",
