    "summary": "For <b>$1.02 per serving</b>, this recipe <b>covers 7%</b> of your daily requirements of vitamins and minerals. One serving contains <b>416 calories</b>, <b>6g of protein</b>, and <b>32g of fat</b>. A mixture of water, butter, cream cheese, and a handful of other ingredients are all it takes to make this recipe so delicious. 20 people have made this recipe and would make it again. From preparation to the plate, this recipe takes around <b>5 hours</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 22%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/banana-cheesecake-bars-with-golden-oreo-crust-540591\">Banana Cheesecake Bars with Golden Oreo Crust</a>, <a href=\"https://spoonacular.com/recipes/copycat-cheesecake-factory-oreo-cheesecake-552762\">Copycat Cheesecake Factory Oreo Cheesecake</a>, and <a href=\"https://spoonacular.com/recipes/cheesecake-factory-bakery-oreo-cheesecake-600720\">Cheesecake Factory Bakery Oreo Cheesecake</a> for similar recipes.",
