    "summary": "Drunken Apple Cake could be just the <b>lacto ovo vegetarian</b> recipe you've been looking for. This recipe serves 6. One serving contains <b>1329 calories</b>, <b>9g of protein</b>, and <b>61g of fat</b>. For <b>$2.11 per serving</b>, this recipe <b>covers 14%</b> of your daily requirements of vitamins and minerals. 7 people have made this recipe and would make it again. If you have sauce, eggs, shortening, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. It is brought to you by Foodista. Overall, this recipe earns a <b>not so great spoonacular score of 27%</b>. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/drunken-apple-cake-kuchen-borracho-597236\">Drunken Apple Cake | Kuchen Borracho</a>, <a href=\"https://spoonacular.com/recipes/hot-spiced-drunken-apple-cider-47966\">Hot Spiced Drunken Apple Cider</a>, and <a href=\"https://spoonacular.com/recipes/drunken-cherry-cake-511673\">Drunken Cherry Cake</a>.",
