    "summary": "For <b>$1.42 per serving</b>, this recipe <b>covers 11%</b> of your daily requirements of vitamins and minerals. One serving contains <b>498 calories</b>, <b>8g of protein</b>, and <b>30g of fat</b>. From preparation to the plate, this recipe takes around <b>45 minutes</b>. If you have pecans, vanillan extract, firmly brown sugar, and a few other ingredients on hand, you can make it. A few people made this recipe, and 13 would say it hit the spot. It is a good option if you're following a <b>vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 36%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/caramel-apple-brownie-cheesecake-209341\">Caramel Apple-Brownie Cheesecake</a>, <a href=\"https://spoonacular.com/recipes/caramel-brownie-cheesecake-530384\">Caramel Brownie Cheesecake</a>, and <a href=\"https://spoonacular.com/recipes/brownie-caramel-cheesecake-131326\">Brownie Caramel Cheesecake</a> for similar recipes.",
