    "summary": "Whole Wheat Chocolate Chip Cookies might be just the dessert you are searching for. For <b>30 cents per serving</b>, this recipe <b>covers 5%</b> of your daily requirements of vitamins and minerals. This recipe makes 24 servings with <b>215 calories</b>, <b>3g of protein</b>, and <b>11g of fat</b> each. A couple people made this recipe, and 59 would say it hit the spot. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. A mixture of butter, baking soda, brown sugar, and a handful of other ingredients are all it takes to make this recipe so flavorful. All things considered, we decided this recipe <b>deserves a spoonacular score of 24%</b>. This score is not so great. Try <a href=\"https://spoonacular.com/recipes/whole-wheat-chocolate-chip-walnut-cookies-my-favorite-chocolate-chip-cookies-487831\">Whole Wheat Chocolate Chip Walnut Cookies {My Favorite Chocolate Chip Cookies}</a>, <a href=\"https://spoonacular.com/recipes/whole-wheat-chocolate-chip-cookies-595894\">Whole Wheat Chocolate Chip Cookies</a>, and <a href=\"https://spoonacular.com/recipes/whole-wheat-chocolate-chip-cookies-163818\">Whole Wheat Chocolate Chip Cookies</a> for similar recipes.",
