    "imageType": "jpg",
    "summary": "You can never have too many soup recipes, so give Asparagus and Pea Soup: Real Convenience Food a try. For <b>$3.24 per serving</b>, this recipe <b>covers 25%</b> of your daily requirements of vitamins and minerals. One serving contains <b>240 calories</b>, <b>11g of protein</b>, and <b>8g of fat</b>. This recipe from fullbellysisters.blogspot.com has 204 fans. From preparation to the plate, this recipe takes about <b>20 minutes</b>. It will be a hit at your <b>Autumn</b> event. If you have onion, peas, a couple of garlic cloves, and a few other ingredients on hand, you can make it. It is a good option if you're following a <b>caveman, gluten free, primal, and vegan</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 96%</b>. This score is spectacular. Try <a href=\"https://spoonacular.com/recipes/butternut-squash-pear-soup-real-convenience-food-716415\">Butternut Squash & Pear Soup: Real Convenience Food</a>, <a href=\"https://spoonacular.com/recipes/tomato-cucumber-onion-salad-with-feta-cheese-real-convenience-food-716416\">Tomato, Cucumber & Onion Salad with Feta Cheese: Real Convenience Food</a>, and <a href=\"https://spoonacular.com/recipes/everyday-granola-from-real-food-real-simple-867924\">Everyday Granola from Real Food, Real Simple</a> for similar recipes.",
