    "summary": "Brined Chicken Breast with Sautéed Onion Dipping Sauce is a <b>gluten free and dairy free</b> main course. One serving contains <b>220 calories</b>, <b>33g of protein</b>, and <b>4g of fat</b>. This recipe serves 6 and costs $1.65 per serving. This recipe from Foodista has 6 fans. It can be enjoyed any time, but it is especially good for <b>The Super Bowl</b>. From preparation to the plate, this recipe takes around <b>45 minutes</b>. A mixture of oregano, juice of lime, salt, and a handful of other ingredients are all it takes to make this recipe so flavorful. To use up the sugar you could follow this main course with the <a href=\"https://spoonacular.com/recipes/whole-wheat-refined-sugar-free-sugar-cookies-557184\">Whole Wheat Refined Sugar Free Sugar Cookies</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 64%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/pretzel-crusted-chicken-breast-tenders-with-garlicky-dipping-sauce-706821\">Pretzel-Crusted Chicken Breast Tenders with Garlicky Dipping Sauce</a>, <a href=\"https://spoonacular.com/recipes/sauted-chicken-with-peanut-dipping-sauce-23367\">Sautéed Chicken with Peanut Dipping Sauce</a>, and <a href=\"https://spoonacular.com/recipes/sauted-chicken-with-peanut-dipping-sauce-35541\">Sautéed Chicken With Peanut Dipping Sauce</a> for similar recipes.",
