    "instructions": "Take your chicken breasts and give them a light coat of the Poultry Magic seasoning, and then coat them with Pam cooking spray. (The Pam keeps the chicken from drying out while cooking.) Grill your chicken breasts and then allow to cool slightly.Preheat your oven to 350 degrees. Shred your chicken and then combine in a 13 x 9 inch glass baking dish with your Louisiana Hot Sauce. Place your cream cheese and dressing into a sauce pan over medium heat until the texture is smooth. Pour this mixture over your chicken and hot sauce mixture in the dish. Top with cheddar cheese and green onions.Bake un-covered for 30 minutes until bubbly. Let stand until slightly cooled, and then serve with tortilla chips of our choice!",
