    "imageType": "jpg",
    "summary": "You can never have too many side dish recipes, so give Beef Tenderloin With Creamy Alouette® Mushroom Sauce a try. Watching your figure? This gluten free and primal recipe has <b>371 calories</b>, <b>11g of protein</b>, and <b>33g of fat</b> per serving. This recipe serves 2 and costs $1.74 per serving. 40 people have tried and liked this recipe. If you have beef tenderloin steaks, milk, shallot, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 51%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/beef-tenderloin-with-mushroom-sauce-405036\">Beef Tenderloin with Mushroom Sauce</a>, <a href=\"https://spoonacular.com/recipes/beef-tenderloin-in-mushroom-sauce-372933\">Beef Tenderloin in Mushroom Sauce</a>, and <a href=\"https://spoonacular.com/recipes/beef-tenderloin-with-mushroom-red-wine-sauce-227676\">Beef Tenderloin with Mushroom-Red Wine Sauce</a> for similar recipes.",
