    "instructions": "<ol><li>Heat broiler.</li><li>Coat all sides of tenderloin with 1 tsp. of the olive oil.  Place on broiler pan.  Season to taste with salt and pepper.  Broil 4 inches from heat for 6 minutes or until well-browned. Turn. Broil 6 to 8 minutes or until desired doneness.</li><li>Meanwhile, heat remaining olive oil and the butter in small skillet over medium heat.</li><li>Add shallot; cook 1 minute.</li><li>Add mushrooms.  Cook 2 to 3 minutes or until tender, stirring frequently.</li><li>Stir in Alouette, adding milk to desired consistency.  Heat just until warm.</li><li>Spoon sauce over tenderloins.  Sprinkle with parsley.</li></ol>",
