    "summary": "The recipe Brussels Sprouts In Honey Butter With Chili Flakes can be made <b>in roughly around 45 minutes</b>. One portion of this dish contains roughly <b>3g of protein</b>, <b>2g of fat</b>, and a total of <b>61 calories</b>. This recipe serves 6 and costs 58 cents per serving. Only a few people really liked this American dish. Head to the store and pick up sprinkle of chili flakes, sea salt, honey, and a few other things to make it today. It can be enjoyed any time, but it is especially good for <b>The Super Bowl</b>. It is a good option if you're following a <b>gluten free, lacto ovo vegetarian, and primal</b> diet. 9 people have made this recipe and would make it again. It works well as a side dish. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 53%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/sweet-chili-brussels-sprouts-541761\">Sweet Chili Brussels Sprouts</a>, <a href=\"https://spoonacular.com/recipes/cran-honey-brussels-sprouts-92511\">Cran-Honey Brussels Sprouts</a>, and <a href=\"https://spoonacular.com/recipes/brussels-sprouts-with-balsamic-honey-748923\">Brussels Sprouts with Balsamic Honey</a> for similar recipes.",
