    "summary": "If you want to add more <b>dairy free</b> recipes to your collection, Toasted\" Agnolotti (or Ravioli) might be a recipe you should try. One serving contains <b>965 calories</b>, <b>41g of protein</b>, and <b>28g of fat</b>. For <b>$1.95 per serving</b>, this recipe <b>covers 21%</b> of your daily requirements of vitamins and minerals. This recipe serves 2. It works well as a main course. 7 people have tried and liked this recipe. If you have g pre-made agnolotti/ravioli, egg, breadcrumbs, and a few other ingredients on hand, you can make it. Not a lot of people really liked this Mediterranean dish. It is brought to you by Foodista. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 59%</b>, which is pretty good. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/butternut-squash-ravioli-agnolotti-di-zucca-375353\">Butternut Squash Ravioli: Agnolotti di Zucca</a>, <a href=\"https://spoonacular.com/recipes/toasted-ravioli-426313\">Toasted Ravioli</a>, and <a href=\"https://spoonacular.com/recipes/toasted-ravioli-756780\">Toasted Ravioli</a>.",
