    "summary": "Cheesy Cowboy Quesadillas takes about <b>10 minutes</b> from beginning to end. One serving contains <b>505 calories</b>, <b>26g of protein</b>, and <b>27g of fat</b>. This recipe serves 4. For <b>$1.28 per serving</b>, this recipe <b>covers 20%</b> of your daily requirements of vitamins and minerals. 16 people have tried and liked this recipe. Head to the store and pick up cheese, cream cheese, canned black beans, and a few other things to make it today. It works well as a Mexican hor d'oeuvre. It is brought to you by Pink When. It is a good option if you're following a <b>gluten free</b> diet. With a spoonacular <b>score of 68%</b>, this dish is good. Try <a href=\"https://spoonacular.com/recipes/cowboy-quesadillas-271129\">Cowboy Quesadillas</a>, <a href=\"https://spoonacular.com/recipes/cheesy-quesadillas-493818\">Cheesy Quesadillas</a>, and <a href=\"https://spoonacular.com/recipes/cheesy-quesadillas-270504\">Cheesy Quesadillas</a> for similar recipes.",
