    "summary": "Hot Cross Buns might be just the morn meal you are searching for. For <b>11 cents per serving</b>, this recipe <b>covers 1%</b> of your daily requirements of vitamins and minerals. One serving contains <b>86 calories</b>, <b>1g of protein</b>, and <b>5g of fat</b>. 11 person have made this recipe and would make it again. It will be a hit at your <b>Easter</b> event. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. A mixture of baking powder, milk, raisins, and a handful of other ingredients are all it takes to make this recipe so yummy. It is a good option if you're following a <b>vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 9%</b>. This score is very bad (but still fixable). Try <a href=\"https://spoonacular.com/recipes/hot-cross-buns-547450\">Hot cross buns</a>, <a href=\"https://spoonacular.com/recipes/hot-cross-buns-hot-cross-buns-561656\">Hot Cross Buns! Hot Cross Buns</a>, and <a href=\"https://spoonacular.com/recipes/hot-cross-buns-205440\">Hot Cross Buns</a> for similar recipes.",
