    "summary": "Classic Matzo Ball Soup might be just the main course you are searching for. For <b>$3.05 per serving</b>, this recipe <b>covers 35%</b> of your daily requirements of vitamins and minerals. This recipe makes 6 servings with <b>1035 calories</b>, <b>76g of protein</b>, and <b>69g of fat</b> each. A couple people made this recipe, and 16 would say it hit the spot. It is perfect for <b>Autumn</b>. It is a good option if you're following a <b>dairy free</b> diet. If you have chicken, carrots, eggs, and a few other ingredients on hand, you can make it. To use up the onion you could follow this main course with the <a href=\"https://spoonacular.com/recipes/candy-corn-cupcakes-63881\">Candy Corn Cupcakes</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 67%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/matzo-ball-soup-873830\">Matzo Ball Soup</a>, <a href=\"https://spoonacular.com/recipes/matzo-ball-soup-697928\">Matzo Ball Soup</a>, and <a href=\"https://spoonacular.com/recipes/matzo-ball-soup-12033\">Matzo Ball Soup</a> for similar recipes.",
