    "imageType": "jpg",
    "summary": "Spicy Salad with Kidney Beans, Cheddar, and Nuts might be just the main course you are searching for. For <b>$4.59 per serving</b>, this recipe <b>covers 37%</b> of your daily requirements of vitamins and minerals. This recipe makes 1 servings with <b>725 calories</b>, <b>27g of protein</b>, and <b>50g of fat</b> each. A mixture of almonds, avocado, kidney beans, and a handful of other ingredients are all it takes to make this recipe so tasty. To use up the avocado you could follow this main course with the <a href=\"https://spoonacular.com/recipes/chocolate-avocado-mousse-quick-dark-chocolate-avocado-mousse-486646\">chocolate avocado mousse | quick dark chocolate avocado mousse</a> as a dessert. From preparation to the plate, this recipe takes about <b>10 minutes</b>. It is a good option if you're following a <b>gluten free and vegetarian</b> diet. Try <a href=\"https://spoonacular.com/recipes/turkey-sausages-with-spicy-kidney-beans-75450\">Turkey Sausages With Spicy Kidney Beans</a>, <a href=\"https://spoonacular.com/recipes/spicy-chopped-kidney-bean-salad-506484\">Spicy Chopped Kidney Bean Salad</a>, and <a href=\"https://spoonacular.com/recipes/stoneground-grits-with-cheddar-cheese-and-spicy-black-beans-meatless-monday-524536\">Stoneground Grits with Cheddar Cheese and Spicy Black Beans – Meatless Monday</a> for similar recipes.",
