    "summary": "Need a <b>gluten free, dairy free, and pescatarian main course</b>? Balsamic & Honey Glazed Salmon with Lemony Asparagus could be a spectacular recipe to try. One portion of this dish contains about <b>25g of protein</b>, <b>21g of fat</b>, and a total of <b>362 calories</b>. For <b>$4.43 per serving</b>, this recipe <b>covers 27%</b> of your daily requirements of vitamins and minerals. This recipe serves 2. 29 people found this recipe to be tasty and satisfying. It is brought to you by Foodista. From preparation to the plate, this recipe takes roughly <b>1 hour</b>. A mixture of juice of lemon, ground pepper, honey, and a handful of other ingredients are all it takes to make this recipe so scrumptious. Overall, this recipe earns an <b>amazing spoonacular score of 98%</b>. <a href=\"https://spoonacular.com/recipes/balsamic-honey-glazed-salmon-267299\">Balsamic-Honey Glazed Salmon</a>, <a href=\"https://spoonacular.com/recipes/easy-balsamic-honey-mustard-glazed-salmon-87226\">Easy Balsamic-Honey-Mustard Glazed Salmon</a>, and <a href=\"https://spoonacular.com/recipes/honey-glazed-salmon-with-asparagus-85472\">Honey Glazed Salmon With Asparagus</a> are very similar to this recipe.",
