    "summary": "Forget going out to eat or ordering takeout every time you crave Southern food. Try making Gluten Free Dairy Free Buttermilk Biscuits at home. For <b>60 cents per serving</b>, this recipe <b>covers 3%</b> of your daily requirements of vitamins and minerals. This recipe serves 12. One serving contains <b>208 calories</b>, <b>5g of protein</b>, and <b>15g of fat</b>. It is brought to you by Foodista. A couple people made this recipe, and 20 would say it hit the spot. A mixture of earth balance butter, arrowroot flour, baking powder, and a handful of other ingredients are all it takes to make this recipe so yummy. It works well as a very affordable side dish. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. It is a good option if you're following a <b>gluten free and lacto ovo vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 7%</b>. This score is very bad (but still fixable). If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/thousand-island-dressing-gluten-free-corn-free-dairy-free-soy-free-nut-free-gum-free-and-refined-sugar-free-512186\">Thousand Island Dressing (Gluten-Free, Corn-Free, Dairy-Free, Soy-Free, Nut-Free, Gum-Free and Refined Sugar-Free)</a>, <a href=\"https://spoonacular.com/recipes/cream-biscuits-and-gravy-dairy-free-gluten-free-sneaky-709417\">Cream Biscuits and Gravy: Dairy-Free, Gluten-Free & Sneaky</a>, and <a href=\"https://spoonacular.com/recipes/sweet-potato-biscuits-gluten-free-dairy-free-484796\">Sweet Potato Biscuits {Gluten-free Dairy-free}</a>.",
