    "summary": "Berry Fruit Crumble might be just the dessert you are searching for. This gluten free, dairy free, and fodmap friendly recipe serves 6 and costs <b>$1.51 per serving</b>. One portion of this dish contains around <b>2g of protein</b>, <b>9g of fat</b>, and a total of <b>159 calories</b>. It is brought to you by Foodista. 18 people have tried and liked this recipe. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. Head to the store and pick up berries, almond meal, ground cinnamon, and a few other things to make it today. All things considered, we decided this recipe <b>deserves a spoonacular score of 36%</b>. This score is rather bad. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/fig-crumble-dessert-fruit-crumble-recipe-57430\">Fig Crumble Dessert (fruit Crumble Recipe)</a>, <a href=\"https://spoonacular.com/recipes/berry-crumble-375560\">Berry Crumble</a>, and <a href=\"https://spoonacular.com/recipes/peach-berry-crumble-126238\">Peach-Berry Crumble</a>.",
