    "summary": "You can never have too many side dish recipes, so give Tomato and Eggplant Caponatan a try. This gluten free and vegan recipe serves 10 and costs <b>77 cents per serving</b>. One serving contains <b>84 calories</b>, <b>2g of protein</b>, and <b>5g of fat</b>. A few people made this recipe, and 53 would say it hit the spot. Head to the store and pick up ground cumin, celery, kalamatan olives, and a few other things to make it today. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 54%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/eggplant-caponata-597342\">Eggplant Caponata</a>, <a href=\"https://spoonacular.com/recipes/eggplant-caponata-23496\">Eggplant Caponata</a>, and <a href=\"https://spoonacular.com/recipes/eggplant-caponata-23450\">Eggplant Caponata</a> for similar recipes.",
