    "imageType": "jpg",
    "summary": "You can never have too many main course recipes, so give Pork Chops with Garlic Cream a try. This recipe makes 4 servings with <b>712 calories</b>, <b>51g of protein</b>, and <b>51g of fat</b> each. For <b>$3.5 per serving</b>, this recipe <b>covers 31%</b> of your daily requirements of vitamins and minerals. A couple people made this recipe, and 13 would say it hit the spot. A mixture of pork chops, shallot, heavy cream, and a handful of other ingredients are all it takes to make this recipe so yummy. To use up the salt you could follow this main course with the <a href=\"https://spoonacular.com/recipes/apple-turnovers-recipe-48175\">Apple Turnovers Recipe</a> as a dessert. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 80%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/pork-chops-with-wine-and-garlic-38622\">Pork Chops with Wine and Garlic</a>, <a href=\"https://spoonacular.com/recipes/honey-garlic-pork-chops-384157\">Honey-Garlic Pork Chops</a>, and <a href=\"https://spoonacular.com/recipes/honey-garlic-pork-chops-450409\">Honey-Garlic Pork Chops</a> for similar recipes.",
