    "summary": "Easy Chicken with White Wine Sauce might be just the main course you are searching for. For <b>$2.24 per serving</b>, this recipe <b>covers 16%</b> of your daily requirements of vitamins and minerals. Watching your figure? This caveman, gluten free, dairy free, and primal recipe has <b>248 calories</b>, <b>30g of protein</b>, and <b>7g of fat</b> per serving. 36 people were impressed by this recipe. Head to the store and pick up flavor concentrated chicken broth, olive oil, shallot, and a few other things to make it today. To use up the dry white wine you could follow this main course with the <a href=\"https://spoonacular.com/recipes/white-wine-frozen-yogurt-206235\">White Wine Frozen Yogurt</a> as a dessert. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 65%</b>. This score is solid. Similar recipes include <a href=\"https://spoonacular.com/recipes/easy-baked-pork-chops-with-white-winemustard-sauce-161398\">Easy Baked Pork Chops with White Wine–Mustard Sauce</a>, <a href=\"https://spoonacular.com/recipes/lemon-chicken-with-white-wine-and-parsley-easy-136812\">Lemon Chicken With White Wine and Parsley Easy</a>, and <a href=\"https://spoonacular.com/recipes/chicken-in-white-wine-sauce-384940\">Chicken in White Wine Sauce</a>.",
